import headerLogo from '../images/Vector.svg';
import './App.css';

function App() {
  return (
    <div className="description">
      <div className="page">
        <div className="header">
          <img src={headerLogo} className="header__logo" alt="Лого" />
        </div>
      </div>
    </div>
  );
}

export default App;
